      Value: "Natural Nubz chew treats provide a healthy and irresistibly delicious way to reward your pup. These occupying dog treats are packed with tasty flavor dogs love and made with only with the finest natural ingredients. They are also highly digestible and do not contain any artificial flavors, artificial colors, or artificial preservatives. Each treat features dental nubs that help clean teeth and freshen breath through chewing action, so your dog can enjoy a healthier smile with every yummy bite. Plus, these long-lasting dog treats will keep your best friend happy, busy, and entertained as they chew. Proudly made in the USA, our natural dog treats will make treat time your pup's favorite part of the day!"
